/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div id="main-movie">
        <p>{this.props.movies.original_title}</p>
        <img
          src={`http://image.tmdb.org/t/p/w342/${this.props.movies.poster_path}`}
        ></img>
      </div>
    );
  }
}

export default MovieList;
